As the tools of hackers become more sophisticated, the technical defenses against cyber-attacks we are all used to are increasingly insufficient. Take it from the Head of IDI's Democracy in the Digital Age Programan expert in cyber security policyDr. Tehilla Shwartz Altshuler, who had no reason to doubt that she was offering professional guidance to a former senior government official. Before long, she realized this was an instance of "spear-phishing." 
Read her op-ed describing the harrowing experience and some important takeaways for society and policymakers as hackers prey on our psychological weaknesses. https://t.co/OlFuXJF3PY
